A realização do curso presencial sobre o tema “Planejamento da Contratação de Obras Públicas e Serviços de Engenharia” é de fundamental importância para o Conselho Regional de Odontologia de Mato Grosso do Sul (CRO-MS), especialmente diante da necessidade iminente de contratação para a reforma da Sede da autarquia. A estrutura física atual já apresenta deficiências que comprometem o bom andamento das atividades internas e o atendimento ao público, reforçando a urgência de um planejamento eficiente e juridicamente seguro para a execução dessa reforma.
O curso tem como objetivo capacitar 10 servidores do CRO-MS, abrangendo 4 profissionais do setor de Licitações e Contratos, o procurador jurídico, o superintendente, o contador da autarquia e 3 membros da diretoria.
A capacitação dos representantes da diretoria é especialmente relevante para demonstrar a complexidade dos processos licitatórios, em particular aqueles relacionados a obras públicas, e para oferecer a eles um conhecimento técnico mínimo sobre o tema. Essa participação contribuirá para que compreendam as dificuldades e responsabilidades envolvidas, reforçando a importância de um planejamento rigoroso e da capacitação do corpo técnico.
O curso será fundamentado na Lei nº 14.133/2021 (Nova Lei de Licitações e Contratos), garantindo conhecimentos atualizados sobre normas, procedimentos e melhores práticas aplicáveis à gestão de contratos de obras públicas.
Benefícios esperados com a realização do curso:
Maior segurança jurídica, garantindo conformidade com a legislação aplicável;
Eficiência no planejamento e execução, minimizando riscos de atrasos, retrabalhos e inconsistências nos processos;
Transparência na gestão pública, com foco na correta aplicação dos recursos;
Capacitação técnica dos servidores-chave, promovendo uma gestão integrada e bem fundamentada.
